Чтобы сообщить компилятору Rust, что мы не хотим использовать обычную цепочку точек входа, мы должны использовать #![no_main] атрибут. #![no_std]
#![no_main] use core::panic::PanicInfo; /// Эта функция вызывается при панике
#[panic_handler]
fn panic(_info: &PanicInfo) -> ! { loop {}
} Вы можете заметить, что мы удалили функцию main. Дело в том, что функция main не имеет смысла без среды выполнения, которая её вызывает. Вместо этого теперь мы перезаписываем точку входа в операционную систему с помощью функции _start: #[no_mangle]
pub extern "C" fn _start() -> ! { loop {}
} Используя атрибут #[no_mangle], мы отключаем искажение имен (name mangling), чтобы гарантировать, что компилятор Rust создаст функцию с именем _start. Без этого атрибута компилятор сгенерирует какой-нибудь загадочный символ, наподобие _ZN3blog_os4_start7hb173fedf945531caE, чтобы дать каждой функции уникальное имя. Атрибут является обязательным, поскольку на следующем шаге нам нужно сообщить имя функции точки входа компоновщику. Мы также должны пометить функцию как extern "C", чтобы сообщить компилятору, что он должен использовать [соглашение о вызове языка Си] (C calling convention) для этой функции (вместо неопределенного соглашения о вызове языка Rust). Причина, по которой мы назвали точку входа именем _start, заключается в том, что это имя точки входа по умолчанию для большинства систем. Возвращаемый тип ! говорит о том, что функция помечена как расходящаяся (diverging), то есть никогда не возвращает результат. Это необходимо, потому что точка входа не вызывается какой-либо функцией, но вызывается непосредственно операционной системой или загрузчиком (bootloader). Поэтому вместо возврата значений точка входа должна, например, вызывать системную функцию exit . В нашем случае выключение устройства может быть разумным действием, так как больше ничего не остается делать, если исполняемый файл завершает свою работу. На данный момент мы выполняем требование, создавая бесконечный цикл. Если запустить cargo build теперь, то мы получим ужасную ошибку компоновщика .

