Сейчас наш крейт неявно подключает стандартную библиотеку. Давайте изменим это, добавив атрибут no_std : // main.rs #![no_std] fn main() { println!("Hello, world!");
} Если попробовать скомпилировать наш крейт (с помощью cargo build), то мы получим сразу несколько ошибок. Самая первая из них: error: cannot find macro `println!` in this scope --> src/main.rs:4:5 |
4 | println!("Hello, world!"); | ^^^^^^^ Макрос println является частью стандартной библиотеки, которую мы больше не подключаем. println использует стандартный вывод , который представляет собой специальный файловый дескриптор, предоставляемый ОС, поэтому теперь мы не можем ничего распечатать. Нам придется удалить println и оставить пустой функцию main, чтобы избавиться от ошибки: // main.rs #![no_std] fn main() {} Если снова попробовать собрать наш крейт, то мы получим следующую ошибку: $ cargo build
error: `#[panic_handler]` function required, but not found
error: language item required, but not found: `eh_personality` Компилятор не смог найти функцию, помеченную атрибутом #[panic_handler], а также языковой элемент eh_personality.

