Атрибут panic_handler определяет функцию, которую компилятор должен вызвать при возникновении паники входе работы программы. Стандартная библиотека предоставляет собственную функцию обработки паники, но так как мы используем no_std, нам нужно определить ее самостоятельно: // в main.rs use core::panic::PanicInfo; /// Эта функция вызывается при панике
#[panic_handler]
fn panic(_info: &PanicInfo) -> ! { loop {}
} Параметр PanicInfo содержит в себе информацию о файле и строку, где произошла паника, а также может содержать сообщение с ошибкой. Функция должна никогда не возвращать результат, поэтому она помечена как расходящаяся функция с помощью возврата пустого типа !. Сейчас мы мало что можем сделать с этой функцией, поэтому просто создадим бесконечный цикл.
